    supplier_id INT,
    report_date DATE,
    total_sales DECIMAL,
    total_expenses DECIMAL
);

CREATE TABLE supplier_dashboards (
    supplier_id INT,
    dashboard_date DATE,
    performance_rating INT,
    issues_found VARCHAR
);

CREATE TABLE supplier_performance (
    supplier_id INT PRIMARY KEY,
    supplier_name VARCHAR(50),
    total_orders INT,
    total_revenue DECIMAL(10, 2)
);

CREATE TABLE order_details (
    order_id INT PRIMARY KEY,
    supplier_id INT,
    order_date DATE,
    order_amount DECIMAL(10, 2)
);

CREATE TABLE supplier_performance_metrics (
    supplier_id INT PRIMARY KEY,
    order_count INT,
    delivery_performance DECIMAL,
    rating FLOAT
);

CREATE TABLE supplier_contacts (
    supplier_id INT PRIMARY KEY,
    contact_name VARCHAR(100),
    contact_email VARCHAR(100),
    contact_phone VARCHAR(15)
);

CREATE TABLE performance_dashboard (
    dashboard_id INT PRIMARY KEY,
    supplier_id INT,
    report_type VARCHAR(50),
    dashboard_url VARCHAR(255)
);

CREATE TABLE supplier_performance_reports (
    supplier_id INT,
